;; **
;;; Unsurprisingly, the graph is empty. Perhaps suprisingly, it will always remain so. **Graphs are immutable** in _GrapeVine_. This is one aspect that sets _GrapeVine_ apart from other graph transformation tools. It follows a functional programming approach. Data structures, once defined, are immutable.
;;; 
;;; If you are perceptive (and have some knowlege of Clojure data types), you may have noted that the above call to `newgrape` returned a list (with a single element) rather than a simple string (as indicated by the brackets `()`). Such a list is called a **graph e**numeration or _grape_ for short. 
;;; 
;;; In _GrapeVine_, all operations that produce graphs actually return _grapes_. We will later see why this data structure makes sense. For now and if the context is clear, we may continue to refer to _grapes_ with a single element as "graphs".
;; **

;; **
;;; # Graph transformations
;;; 
;;; Graph transformations are usually defined by _rules_ that _rewrite_ a given input graph to produce one (or often several possible) output graphs.
;;; 
;;; ![](https://upload.wikimedia.org/wikipedia/commons/d/d7/GraphRewriteExample_color.png) [Wikipedia](https://en.wikipedia.org/wiki/Graph_rewriting)
;;; 
;;; Traditionally, rewrite rules have a _left-hand side_ (L) and a _right-hand side_ (R), where L describes a pattern to be matched in the input graph and the R defines how that pattern should be modified (e.g., by adding or deleting nodes and edges). 
;;; 
;;; The graph elements that appear on both sides (L and R) are preserved; they are referred to as the rule's _interface_.
;;; 
;;; Modern graph transformation tools use a more compact notation for representing rules, by "_collapsing_" LHS and RHS into a single graph and, therefore, avoiding the need to repeat the _interface_ on both sides of the rule. _GrapeVine_ uses this approach. 
;;; 
;;; Many graph transformation tools have diagramming editors to write rules. While this may be convenient, these editors come with a steep learning curve and don't integrate well with common programming languages and tools (which are text-based). 
;;; 
;;; _GrapeVine_ uses a light-weight, _hybrid_ approach with a textual input language and a graphical view. 
;;; 
;;; This is illustrated with three example rules below. 
;;; 
;;; 1. The first rule (**`hello`**) creates a new node of type _Hello_
;;; 1. The second rule (**`world`**) looks for an existing node of type `Hello` and connects it with a new node of type `World`.
;;; 2. The third rule (**`vine`**) looks for two nodes of type `Hello` and `World`, respectively, which are connected with a `to` edge and replaces the `World` node with a node of type `Grape`. 
;;; 
;;; The **textual syntax** should be fairly self-explanatory. Each rule is defined in a `rule` form, given a name and a parameter list ([ ]) (all empty in the examples below). Elements (nodes and edges) on the left side of the rule appear in the **`read`** form. New elements to be created on the right side of the rule appear in the **`create`** form. A **`delete`** form is used to identify removed elements. The third rule shows how attributes are defined, with the example of a `Grape` node (`calories`).
;;; 
;;; >_Note that the `list` form that encloses the three rule definitions is not necessary but purely cosmetic. It renders the visual representation of the three rules in one row in the notebook._
;; **

;; **
;;; 
;; **

;; @@
(list 
 (rule hello []
   (create 
     (node :Hello)))

(rule world []
   (read 
      (node h:Hello))
   (create 
      (node w:World)
      (edge :to h w )))

(rule vine []
   (read 
      (node h:Hello)
      (node w:World)
      (edge e:to h w ))
   (delete w e)
   (create 
      (node g:Grape {:calories "104"})
      (edge :to h g))))
;; @@
