;; **
;;; > _Note: Indeed, the function `view(g)` is merely a shortcut for writing `(viewquery (_any? g))`. _
;; **

;; **
;;; # History and Traces
;;; As explained above, rules are applied to graphs (in _grapes_) and are used to _derive_ new graphs. This history of __derivations__ of graphs can themselves be represented as a graph, where the nodes represent graphs and edges represent _occurrences_ of graph transformations (i.e., rule applications).
;;; 
;;; ## History Graph
;;; 
;;; We define the __history graph__ of a given graph _g_ as the graph that contains all graphs (and derivations) that _g_ depends on or that depend on _g_. 
;;; 
;;; The above definition can easily be extended to _grapes_: Since computations with _grapes_ always start with a _grape_ that contains a single graph only, the history graph of a _grape_ is defined as the history graph of the unique original start graph that all graphs in the _grape_ depend on.
;;; 
;;; We can generate the _history graph_ of a _grape_ using the `history` function:
;; **

;; @@
(def h (-> (newgrape) hello hello world* vine history))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/h</span>","value":"#'tutorial/h"}
;; <=

;; **
;;; A history graph is just a regular graph and can be operated on accordingly. For example, we can view the history graph we just created using the view function.
;; **

;; @@
(view h)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"813\" height=\"669\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5caa81db \"BufferedImage@5caa81db: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7ed33bea transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 813 height = 669 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x5caa81db \"BufferedImage@5caa81db: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7ed33bea transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 813 height = 669 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 813, :height 669})"}
;; <=

;; **
;;; ## Derivation steps
;;; The history shown above consists of four derivation steps:
;;; > 1. Step 1: hello
;;; > 1. Step 2: hello
;;; > 1. Step 3: world* (two concurrent derivations)
;;; > 1. Step 4: vine (two concurrent derivations)
;;; 
;;; Each of these steps can be represented by a _grape_. We can use the form `steps` to attain this sequence of _grapes_ that characterize a history graph: 
;; **

;; @@
(steps h)
;; @@
;; =>
