;; **
;;; ## Traces
;;; 
;;; In many cases, we are not interested in the entire history graph of a _grape_. Rather, we may just be interested the derivation steps that led to a particular graph. We call the (linear) sequence of derivation steps that let to a particular graph the __trace__ of that graph.
;;; 
;;; Anologously to history graphs, traces can be represented in graph form (showing linear chains of derivations).
;;; 
;;; The `traces` form computes a graph trace for all graphs in a given _grape_:
;; **

;; @@
(-> (newgrape) hello hello world* vine traces view )
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"425\" height=\"669\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6fa932b4 \"BufferedImage@6fa932b4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7ed33bea transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 425 height = 669 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x6fa932b4 \"BufferedImage@6fa932b4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7ed33bea transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 425 height = 669 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 425, :height 669})"}
